import React from "react";
import "./app.scss";
import {
  Form,
  FormGroup,
  Select,
  SelectItem,
  Button,
  Loading,
} from "carbon-components-react";
import { years, months, costCentrees, accounts } from "./utils";

function App() {
  return (
    <div className="App">
      <div className="mainContainer">
        <Form>
          <FormGroup>
            <Select id="select-0" labelText="Select Year">
              {years.map((yearVal) => (
                <SelectItem text={yearVal} valu={yearVal} />
              ))}
            </Select>
          </FormGroup>
        </Form>
      </div>
    </div>
  );
}

export default App;
